(function($){
    $.yuiEditor = function(el, options){
        var base 		= this;
				var editor	= null;
        base.$el 		= $(el);
        base.el 		= el;
        base.$el.data("yuiEditor", base);
        
        base.init = function(){
            base.options = $.extend({}, $.yuiEditor.defaultOptions, options);
						base.$el.parent().addClass(base.options.skin);
						
						editor = new YAHOO.widget.Editor(base.el, base.options);       
						$.extend(editor, $.yuiEditor.i18n);
						editor.render();
        };

        base.init();
    };
    
    $.yuiEditor.defaultOptions = {
			skin:			'yui-skin-default',
			height: 	'300px',
			width: 		'600px',
			dompath: 	false,
			animate: 	true,
   		toolbar: {
				titlebar: 'Editer le texte',
       		buttons: [
            { group: 'textstyle', label: 'Styles',
            	buttons: [
								{ type: 'select', label: 'Normal', value: 'heading', disabled: true, 
									menu: [ 
										{ text: 'Normal', value: 'none', checked: true }, 
										{ text: 'Header 1', value: 'h1' }, 
										{ text: 'Header 2', value: 'h2' }, 
										{ text: 'Header 3', value: 'h3' }, 
										{ text: 'Header 4', value: 'h4' }, 
										{ text: 'Header 5', value: 'h5' }, 
										{ text: 'Header 6', value: 'h6' } 
									] 
							},
							{ type: 'separator' },
							{ type: 'push', label: 'Gras', value: 'bold' },
							{ type: 'push', label: 'Italique', value: 'italic' },
							{ type: 'separator' },
							{ type: 'push', label: 'Supprimer le formatage', value: 'removeformat' }, 
							{ type: 'push', label: 'Afficher/Masquer les éléments invisibles', value: 'hiddenelements' } 
            ]
          },
					{ group: 'alignment', label: 'Alignment', 
						buttons: [ 
							{ type: 'push', label: 'Aligner à Gauche CTRL + SHIFT + [', value: 'justifyleft' }, 
							{ type: 'push', label: 'Centrer CTRL + SHIFT + |', value: 'justifycenter' }, 
							{ type: 'push', label: 'Aligner à Droite CTRL + SHIFT + ]', value: 'justifyright' }, 
							{ type: 'push', label: 'Justifier', value: 'justifyfull' } 
						] 
					},
					{ group: 'indentlist', label: 'Listes', 
						buttons: [ 
							{ type: 'push', label: 'Liste non-ordonnée', value: 'insertunorderedlist' }, 
							{ type: 'push', label: 'Liste ordonnée', value: 'insertorderedlist' }
						] 
					}, 
					{ group: 'insertitem', label: 'Insertions', 
						buttons: [ 
							{ type: 'push', label: 'Lien CTRL + SHIFT + L', value: 'createlink' }, 
							{ type: 'push', label: 'Image', value: 'insertimage' } 
						]
					} 
       	]
    	}
		}

    $.yuiEditor.i18n = {
			STR_COLLAPSE: 				'Maquer la barre d\'outils',
			STR_EXPAND: 					'Afficher la barre d\'outils',
			STR_SPIN_LABEL: 			'Valeur {VALUE}. Utilisez Control + Shift + Haut ou Control + Shift + Bas pour augmenter ou réduire les valeurs.',
			STR_SPIN_UP: 					'Cliquer pour augmenter la valeur',
			STR_SPIN_DOWN: 				'Cliquer pour réduire la valeur',
			STR_LEAVE_EDITOR: 		'Vous avez quittez l\'éditeur.',
			STR_BEFORE_EDITOR: 		'Ce champs de saisie peut contenir des textes et illustrations. Pour navigeur dans les options de formatage, utilisez le raccourcis Shift + Echape pour placer le focus sur la barre d\'outils et naviguez avec les flêches. Pour quitter l\'éditeur, pressez la touche Echape. <h4>Raccourcis :</h4><ul><li>Control + Shift + B pour mettre en gras</li> <li>Control + Shift + I pour mettre en italique</li> <li>Control Shift U underlines text</li> <li>Control + Shift + L pour ajouter un lien</li></ul>',
			STR_TITLE: 						'Editeur de texte.',   
			STR_CLOSE_WINDOW: 		'Fermer la fenêtre',
			STR_CLOSE_WINDOW_NOTE:'Control + Shift + W pour fermer cette fenêtre',
			STR_IMAGE_HERE: 			'Entrez l\'URL de l\'image',
			STR_IMAGE_URL: 				'Image',   		
			STR_IMAGE_PROP_TITLE: 'Options d\'image',
			STR_IMAGE_TITLE: 			'Description',
			STR_IMAGE_SIZE: 			'Taille',
			STR_IMAGE_ORIG_SIZE: 	'Taille originale',
			STR_IMAGE_COPY: 			'<span class="tip"><span class="icon icon-info"></span><strong>Note :</strong> Pour déplacer l\'image, sélectionnez-la, coupez-là et collez-la où bon vous semble.</span>',
			STR_IMAGE_PADDING: 		'Padding',
			STR_IMAGE_BORDER: 		'Bordure',
			STR_IMAGE_BORDER_SIZE:'Taille de bordure',
			STR_IMAGE_BORDER_TYPE:'Type de bordure',
			STR_IMAGE_TEXTFLOW: 	'Alignement',
			STR_LINK_URL: 				'Lien',
			STR_LINK_PROP_TITLE: 	'Options de lien',
			STR_LINK_PROP_REMOVE: 'Supprimer le lien du texte',
			STR_LINK_NEW_WINDOW: 	'Ouvrir dans une nouvelle fenêtre',
			STR_LINK_TITLE: 			'Description',
			STR_NONE: 						'Aucun'
		}
		
    $.fn.yuiEditor = function(options){
        return this.each(function(){
            (new $.yuiEditor(this, options));
        });
    };
    
    $.fn.getyuiEditor = function(){
        this.data("yuiEditor");
    };
})(jQuery);

